import { useState } from "react";
import { Box, Button, TextField, useMediaQuery, useTheme } from "@mui/material";
import { Formik } from "formik";
import * as yup from "yup";
import { useNavigate } from "react-router-dom";

// ConvertKit API keys and IDs
const convertKitAPIKey = "YOUR_CONVERTKIT_API_KEY";
const convertKitFormID = "YOUR_CONVERTKIT_FORM_ID";

const registerSchema = yup.object().shape({
  firstName: yup.string().required("required"),
  lastName: yup.string().required("required"),
  email: yup.string().email("invalid email").required("required"),
  occupation: yup.string().required("required"),
});

const initialValuesRegister = {
  firstName: "",
  lastName: "",
  email: "",
  occupation: "",
};

const Form = () => {
  const { palette } = useTheme();
  const navigate = useNavigate();
  const isNonMobile = useMediaQuery("(min-width:600px)");
  const [loading, setLoading] = useState(false);

  const submitToConvertKit = async (values) => {
    try {
      await fetch(
        `https://api.convertkit.com/v3/forms/${convertKitFormID}/subscribe`,
        {
          method: "POST",
          headers: { "Content-Type": "application/json" },
          body: JSON.stringify({
            api_key: convertKitAPIKey,
            email: values.email,
            first_name: `${values.firstName} ${values.lastName}`, // Combine first and last name
            fields: {
              occupation: values.occupation,
            },
          }),
        }
      );
    } catch (error) {
      console.error("ConvertKit subscription error:", error);
    }
  };

  const handleFormSubmit = async (values, onSubmitProps) => {
    setLoading(true);
    await submitToConvertKit(values);
    setLoading(false);
    onSubmitProps.resetForm();
    navigate("/"); // Navigate to homepage
  };

  return (
    <Formik
      onSubmit={handleFormSubmit}
      initialValues={initialValuesRegister}
      validationSchema={registerSchema}
    >
      {({
        values,
        errors,
        touched,
        handleBlur,
        handleChange,
        handleSubmit,
      }) => (
        <form onSubmit={handleSubmit}>
          <Box
            display="grid"
            gap="30px"
            gridTemplateColumns="repeat(4, minmax(0, 1fr))"
            sx={{
              "& > div": { gridColumn: isNonMobile ? undefined : "span 4" },
            }}
          >
            <TextField
              label="First Name"
              onBlur={handleBlur}
              onChange={handleChange}
              value={values.firstName || ""}
              name="firstName"
              error={Boolean(touched.firstName) && Boolean(errors.firstName)}
              helperText={touched.firstName && errors.firstName}
              sx={{ gridColumn: "span 2" }}
            />
            <TextField
              label="Last Name"
              onBlur={handleBlur}
              onChange={handleChange}
              value={values.lastName || ""}
              name="lastName"
              error={Boolean(touched.lastName) && Boolean(errors.lastName)}
              helperText={touched.lastName && errors.lastName}
              sx={{ gridColumn: "span 2" }}
            />
            <TextField
              label="Email"
              onBlur={handleBlur}
              onChange={handleChange}
              value={values.email || ""}
              name="email"
              error={Boolean(touched.email) && Boolean(errors.email)}
              helperText={touched.email && errors.email}
              sx={{ gridColumn: "span 4" }}
            />
            <TextField
              label="Occupation"
              onBlur={handleBlur}
              onChange={handleChange}
              value={values.occupation || ""}
              name="occupation"
              error={Boolean(touched.occupation) && Boolean(errors.occupation)}
              helperText={touched.occupation && errors.occupation}
              sx={{ gridColumn: "span 4" }}
            />
          </Box>

          <Box mt={2}>
            <Button
              fullWidth
              type="submit"
              disabled={loading}
              sx={{
                position: "relative",
                zIndex: 0,
                m: "2rem 0",
                p: "1rem",
                backgroundColor: "#2C654299", // Base color with opacity
                color: palette.background.alt,
                "&:hover": {
                  backgroundColor: "#1E472F", // Darker green on hover
                  color: "#fff", // Ensures text is readable on hover
                },
              }}
            >
              {loading ? "Submitting..." : "Register"}
            </Button>
          </Box>
        </form>
      )}
    </Formik>
  );
};

export default Form;
